import React from "react"
class Home extends React.Component{
    render(){
        const{cases}=this.props;
        console.log("home",cases)
        return(
            <>
            {cases.map((country)=>(
                <>
                <div className="container">
            <div className="Home-div">
                <div className="cases"><p>{country.Country}</p></div>
                <div className="cases"><p>{country.TotalConfirmed}</p></div>
                <div className="cases"><p>{country.TotalRecovered}</p></div>
                <div className="cases"><p> {country.TotalDeaths}</p></div>
                <div className="cases"><p>{country.NewConfirmed}</p></div>
                <div className="cases"><p>{country.NewRecovered}</p></div>
                <div className="cases"><p>{country.Date}</p></div>

            </div>
            </div>
                </>
            ))}
           
            </>
        )
    }
}
export default Home;
